actionConfiguration.body:
() => {
  var sql = "select *\n";
  sql += "from OEM_Sample\n";
  for (let i = 0; i < Tb_barcode_print.selectedRows.length; i++) {
    if (i === 0) {
      sql += "WHERE ";
    } else {
      sql += "OR ";
    }
    sql += "Barcode = '" + Tb_barcode_print.selectedRows[i].Barcode + "'\n";
  }
  sql += "ORDER BY ID DESC\n";
  return sql;
}

